import React from 'react';

const Lemmikud = ({ people }) => {
    // Now you can access the people prop directly
    return (
        <div className="container">
            <h2>People:</h2>
            <ul>
                {people.map((person, index) => (
                    <li key={index}>{person.name}</li>
                ))}
            </ul>
        </div>
    );
}

export default Lemmikud;
